import { Link } from 'react-router-dom';

function Guides() {
  const vetLink = "https://www.doctordolittle.co.il/Suppliers/2/%D7%95%D7%98%D7%A8%D7%99%D7%A0%D7%A8%D7%99%D7%9D.html";

  return (
    <div>
      <h2>Guides</h2>
      <p>We're sure you have many questions after adding a furry friend to your family.</p>
      <p>To help with that, we grouped together a few articles and guides regarding common topics.</p>
      <p>Please let us know if something important is missing!</p>

      <p style={{ marginTop: '40px' }}>1. <a href="https://www.doctordolittle.co.il/Suppliers/2/%D7%95%D7%98%D7%A8%D7%99%D7%A0%D7%A8%D7%99%D7%9D.html">list of veterinarian in Israel</a></p>
      <p>If you have any questions, feel free to <a href="mailto:filavmooki@gmail.com">contact us</a>.</p>
      <p>This is our final project for the Java workshop course.</p>


    </div>
  );
}

export default Guides;
